import React, { Fragment } from "react";

function Study() {
  const cardFront = (
    <Fragment>
      <h1>Study: Deck Title</h1>
      <div class="card">
        <div class="card-body">
          <h5 class="card-title">Card 1 of 3</h5>
          <p class="card-text">Front of card text</p>
          <button href="#" class="btn btn-secondary">
            Flip
          </button>
        </div>
      </div>
    </Fragment>
  );

	const cardBack = (
    <Fragment>
      <h1>Study: Deck Title</h1>
      <div class="card">
        <div class="card-body">
          <h5 class="card-title">Card 1 of 3</h5>
          <p class="card-text">Front of card text</p>
          <button href="#" class="btn btn-secondary">
            Flip
          </button>
        </div>
      </div>
    </Fragment>
  );
  return cardFront;
}

export default Study;
